// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.20;

// Uncomment this line to use console.log
// import "hardhat/console.sol";


contract XPReward {

    uint256 public timesSigned = 0;

    uint256 public timesUpdated = 0;

    mapping(address => uint256) public xpBalances;
    mapping(address => uint256) public lastClaimedTimestamp;

    event XPClaimed(address indexed user, uint256 amount);

    function claimXP() public {
        require(
            block.timestamp >= lastClaimedTimestamp[msg.sender] + 1 minutes,
            "You can only claim once every 1 minute."
        );

        lastClaimedTimestamp[msg.sender] = block.timestamp;
        xpBalances[msg.sender] += 1;

        emit XPClaimed(msg.sender, 1);
    }

    function updateTimeSigned()  public {
        timesSigned ++;
    }

    function updateTimeUpdated()  public {
        timesUpdated ++;
    }

    function getMyXP() public view returns (uint256) {
        return xpBalances[msg.sender];
    }

    function timeUntilNextClaim() public view returns (uint256) {
        if (block.timestamp >= lastClaimedTimestamp[msg.sender] + 1 minutes) {
            return 0;
        } else {
            return (lastClaimedTimestamp[msg.sender] + 1 minutes) - block.timestamp;
        }
    }
}

